import React from 'react';
import Star from '../assets/star.png'; 
import locations from '../locations.json';
import { useParams } from 'react-router-dom';
import "../Locations.css";

const RatingStars = () => {
    const { id } = useParams();
    const location = locations.find(location => location.id === id);
    
    if (!location || !location.rating) {
        return null; // Return null if location is not found or if rating is not available
    }

    const rating = parseInt(location.rating); // Convert rating to integer

    const starArray = [];
    const totalStars = 5; // Total number of stars

    for (let i = 1; i <= totalStars; i++) {
        if (i <= rating) {
            starArray.push(<img key={i} src={Star} alt="star" className="star-filled" />);
        } else {
            starArray.push(<img key={i} src={Star} alt="star" className="star-empty" />);
        }
    }

    return (
        <div className="rating__stars">
            {starArray}
        </div>
    );
};

export default RatingStars;
